- input: TEXT,F3XA,,"This amendment is in response to the FEC's letter of March 31
    2004.    The ASDC is a political party committee that is an association of the
    fifty state party committees as well as the party committees of several American
    territories.  The committee's funds consist of transfers from affiliated party
    committees as well as contributions that are subject to the prohibitions and limitations
    of the Federal Election Campaign Act.     The ASDC currently maintains only two
    full-time employees and utilizes office space currently occupied by the Democratic
    National Committee an affiliated national party committee.  Accordingly the ASDC's
    operating expenses are of a limited nature. Needless to say all operating expenses
    of the ASDC are paid for with federal funds. Furthermore any expenses that may
    be incurred by the DNC including office rent and supplies on behalf of ASDC are
    also paid for with federal funds.    If you have any questions please contact
